import java.util.*;
public class if_and_if_else {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int a=sc.nextInt();
		if(a>=0) {
			System.out.println("positive");}
		else {
				System.out.println("negative");
				sc.close();
			}
		

	}

}
